better main:
waiting = True
    commands = ["save", "load", "list", "delete", "keys", "close", "commands"]
    if len(sys.argv) == 2:
        command = sys.argv[1]
        print(command)
        if command == "save":
            data = clipboard.paste()
            key = input(f"Please write a key for this data:  \n <<{data}>> \n")
            save_data(SAVED_DATA, data, key)
        elif command == "load":
            key = input(f"Please write the key of the data you want: ")
            data = load_data(SAVED_DATA, key)
            clipboard.copy(data)
            print(f"You have loaded: \n <<{data}>> \n")
        elif command == "list":
            print(load_dict(SAVED_DATA))
        elif command == "delete":
            key = input("Please enter the key of the data that you want to delete")
            delete_data(SAVED_DATA, key)
        elif command == "keys":
            my_dict = load_dict(SAVED_DATA)
            print(my_dict.keys())
        elif command == "close":
            waiting = False
        elif command == "commands":
            print(commands)
        else:
            print("Unknown command")
